('2416','18','7927','Antonio',Null,'Grundstück mit Projekt für eine moderne Meerblickvilla in Sol de Mallorca','33931','Sol de Mallorca liegt im Südwesten Mallorcas in der Gemeinde Calvia. Zu internationalen Schulen, Golfplätzen, Jachthäfen, Restaurants und nach Palma de Mallorca sind es nur wenige Fahrminuten. Auf einem 1.500m² großen, flachen Meerblickgrundstück wurde eine moderne Villa geplant. Baubeginn soll Frühjahr 2016 sein und Mitte 2017 kann die Villa bezogen werden. Die ca 320m² konstruierte Fläche verteilt sich auf 2 Wohnetagen. Auf der Wohnebene betritt man die Villa über eine Eingangsdiele mit anschließendem Wohn-Esszimmer, moderne Einbauküche, Hauswirtschaftsraum, Gäste WC, Gäste Zimmer mit Bad en suite.  Im 1. OG befinden sich 2 Schlafzimmer mit je einem Bad en suite sowie einer Terrasse mit Außentreppe zum Pool.  Zusätzlich bietet die Villa noch 120m² Keller, inklusive 2 Tiefgaragenplätze, Technikraum und Abstellraum. Zum jetzigen Zeitpunkt kann der Käufer noch Einfluss auf die Auswahl der Ausstattung nehmen','33932','1600000','106','2015-12-14 11:24:42','106','2015-12-14 11:25:42',Null,'2547','125','1196',1,'1','0',Null,Null,Null,'33933',Null,'0','0','0',Null,'2015-12-14 14:19:18',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33934',Null,'33935',Null,'33936',Null,'33937',Null,'33938','0',0,'0');
